goog.provide("goog.math.tdma"),goog.math.tdma.solve=function(o,t,e,n,g){t=t.slice(),n=n.slice();const r=t.length;let c;for(c=1;c<r;++c){const g=o[c-1]/t[c-1];t[c]=t[c]-g*e[c-1],n[c]=n[c]-g*n[c-1]}const l=g||new Array(n.length);for(l[r-1]=n[r-1]/t[r-1],c=r-2;c>=0;--c)l[c]=(n[c]-e[c]*l[c+1])/t[c];return l};